import ListDidItem from "../listDidItem"

export const renderDidList = (didDisplay) => {
  let container = []
  let i = 0
  while (i < 100) {
    if (!did[i]) break
    container.push(did[i])
    i++;
  }
  
  if (didDisplay) {
    return container.map((item, i) => (
      <ListDidItem
      key={`ID${i}DID`}
      did={item[0].data}
      line={item[1].data}
      location={item[2].data}
      area={item[3].data}
      description={item[4].data}
      assigned={item[5].data}
      />
    ))
  }
}
